export const COLUMNS = [
  {
    Header: "Common Name",
    accessor: "comName",
    Cell: (props) => {
      return <td com={props.com}>{props.cell.value}</td>;
    },
  },
  {
    Header: "Scientific Name",
    accessor: "sciName",
    Cell: (props) => {
      return (
        <td
          onClick={(e) => {
            const ebird_redirect = `https://ebird.org/species/${props.cell.row.original["speciesCode"]}`;
            window.open(ebird_redirect);
            console.log(props.cell.row.original["speciesCode"]);
          }}
          sci={props.sci}
        >
          {props.cell.value}
        </td>
      );
    },
  },
  {
    Header: "Location",
    accessor: "locName",
  },
  {
    Header: "Date",
    accessor: "obsDt",
  },
];
